import Navbar from 'react-bootstrap/Navbar';
import {NavLink} from "react-router-dom";
import {NavDropdown} from "react-bootstrap";

function Header() {
    return (
        <Navbar bg={"dark"} variant={"dark"} className={'navbar-padding'}>
            <NavLink to="/" className={'item'}>
                Cours React
            </NavLink>
            <NavDropdown title={'Exemples'}>
                <NavDropdown.Item>Exemple 1</NavDropdown.Item>
                <NavDropdown.Item>Exemple 2</NavDropdown.Item>
                <NavDropdown.Item>Exemple 3</NavDropdown.Item>
                <NavDropdown.Item>Exemple 4</NavDropdown.Item>
            </NavDropdown>
            <NavLink to="/todolist" className={'item'}>
                Todo
            </NavLink>
        </Navbar>
    )
}

export default Header;
